local EncodeBase64, DecodeBase64, Save, Socket, DownloadString, DownloadFile
do
    EncodeBase64 = function(data)
        local b64 = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/'
        return ((data:gsub('.', function(x)
            local r, b = '', x:byte()
            for i = 8, 1, -1 do
                r = r..(b % 2 ^ i - b % 2 ^ (i - 1) > 0 and '1' or '0')
            end
            return r;
        end) .. '0000'):gsub('%d%d%d?%d?%d?%d?', function(x)
        if (#x < 6) then
            return ''
        end
        local c = 0
        for i = 1, 6 do
            c = c + (x:sub(i, i) == '1' and 2 ^ (6 - i) or 0)
        end return b64:sub(c + 1, c + 1) end) .. ({'', '==', '='})[#data % 3 + 1])
    end
    
    DecodeBase64 = function(data)
        local b64 = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/'
        data = string.gsub(data, '[^'..b64..'=]', '')
        return (data:gsub('.', function(x)
            if (x == '=') then return '' end
            local r, f = '', (b64:find(x) - 1)
            for i = 6, 1, -1 do r = r..(f % 2 ^ i - f % 2 ^ (i - 1) > 0 and '1' or '0') end return r;
        end):gsub('%d%d%d?%d?%d?%d?%d?%d?', function(x)
            if (#x ~= 8) then return '' end
            local c = 0
            for i = 1, 8 do c = c + (x:sub(i, i) == '1' and 2 ^ (8 - i) or 0) end return string.char(c)
        end))
    end

    Save = function(path, str)
        local f = open(path, "w")
        f:write(str)
        f:close()
    end

    if not FileExist(COMMON_PATH .. 'mime_core.dll') then
        Save(COMMON_PATH .. 'mime_core.dll', DecodeBase64(''))
    end
    
    if not FileExist(COMMON_PATH .. 'socket_core.dll') then
        Save(COMMON_PATH .. 'socket_core.dll', DecodeBase64(''))
    end
    
    if not FileExist(COMMON_PATH .. 'lua_ltn12.lua') then
        Save(COMMON_PATH .. 'lua_ltn12.lua', DecodeBase64(''))
    end
    
    if not FileExist(COMMON_PATH .. 'lua_mime.lua') then
        Save(COMMON_PATH .. 'lua_mime.lua', DecodeBase64(''))
    end
    
    if not FileExist(COMMON_PATH .. 'lua_socket.lua') then
        Save(COMMON_PATH .. 'lua_socket.lua', DecodeBase64(''))
    end
    
    if not FileExist(COMMON_PATH .. 'lua_socket_ftp.lua') then
        Save(COMMON_PATH .. 'lua_socket_ftp.lua', DecodeBase64(''))
    end

    if not FileExist(COMMON_PATH .. 'lua_socket_headers.lua') then
        Save(COMMON_PATH .. 'lua_socket_headers.lua', DecodeBase64(''))
    end
    
    if not FileExist(COMMON_PATH .. 'lua_socket_http.lua') then
        Save(COMMON_PATH .. 'lua_socket_http.lua', DecodeBase64(''))
    end
    
    if not FileExist(COMMON_PATH .. 'lua_socket_smtp.lua') then
        Save(COMMON_PATH .. 'lua_socket_smtp.lua', DecodeBase64(''))
    end
    
    if not FileExist(COMMON_PATH .. 'lua_socket_tp.lua') then
        Save(COMMON_PATH .. 'lua_socket_tp.lua', DecodeBase64(''))
    end

    if not FileExist(COMMON_PATH .. 'lua_socket_url.lua') then
        Save(COMMON_PATH .. 'lua_socket_url.lua', DecodeBase64(''))
    end

    Socket = require("lua_socket_http")

    DownloadString = function(url)
        local http = url:sub(1, 5) == "https"
        url = http and url:sub(9) or url:sub(10)
        for i = 1, 5 do
            local body, code, headers, status = Socket.request(tostring('http://gamingonsteroids.com/GOS/TCPUpdater/GetScript' .. (http and 6 or 5) .. '.php?script=' .. EncodeBase64(url) .. '&rand=' .. random(99999999)))
            if body then
                local _CS, ContentStart = body:find('<scr' .. 'ipt>')
                local ContentEnd, _CE = body:find('</scr' .. 'ipt>')
                if ContentStart and ContentEnd then
                    return true, DecodeBase64(body:sub(ContentStart + 1, ContentEnd - 1)), code, headers, status
                end
            end
        end
        return false, body, code, headers, status
    end

    DownloadFile = function(a, b)
        local url, path
        
        do -- get url
            if a:find("raw.githubusercontent.com") then
                url = a
                a = nil
            elseif b:find("raw.githubusercontent.com") then
                url = b
                b = nil
            else
                assert(false, "DownloadFile: wrong arguments (no url)")
            end
        end
        
        do -- get path
            if a then
                path = a
            elseif b then
                path = b
            else
                assert(false, "DownloadFile: wrong arguments (no path)")
            end
        end

        local success, body, code, headers, status = DownloadString(url)

        if not success then
            assert(false, "Downloader Error ! Please try again 2xF6 !")
            return false
        end

        Save(path, body)

        return true
    end
end

local BaseUrl, Version, OldVersion, NewVersion
do -- get version.lua
    BaseUrl = "https://raw.githubusercontent.com/gamsteron/Gamsteron/master/"

    local oldPath, newPath, url

    oldPath = COMMON_PATH .. "Gamsteron_Version_Old.lua"
    newPath = COMMON_PATH .. "Gamsteron_Version.lua"
    url = BaseUrl .. "Gamsteron_Version.lua"
    
    if FileExist(oldPath) then
        OldVersion = require("Gamsteron_Version_Old")
    end

    if not DownloadFile(url, newPath) then
        return
    end
    
    NewVersion = require("Gamsteron_Version")
end

do -- download updates
    local function SaveOldVersion()
        local f = open(COMMON_PATH .. "Gamsteron_Version.lua", "r")
        Save(COMMON_PATH .. "Gamsteron_Version_Old.lua", f:read("*all"))
        f:close()
    end

    Version = 0
    local success, downloaded = true, false
    for k, v in pairs(NewVersion) do
        Version = Version + v
        if not FileExist(COMMON_PATH .. k .. ".lua") or OldVersion == nil or OldVersion[k] == nil or v > OldVersion[k] then
            print("Downloading " .. k .. ".lua, please wait...")
            if not DownloadFile(COMMON_PATH .. k .. ".lua", BaseUrl .. k .. ".lua") then
                success = false
                break
            end
            downloaded = true
        end
    end

    if not success then
        return
    end

    if downloaded or not FileExist(COMMON_PATH .. "Gamsteron_Version_Old.lua") then
        SaveOldVersion()
    end
    
    if downloaded then
        print("Update Completed, please 2x F6!")
        return
    end
end

